INSERT INTO `t_text_content` VALUES (1,'{\"titleContent\":\"<p><span style=\\\"font-size: 20px;\\\">632年，穆罕默德率10万穆斯林在麦加进行了一次经过改革的朝觐，史称“穆斯林朝觐”。</span><br/></p>\",\"analyze\":\"解析\",\"questionItemObjects\":[{\"prefix\":\"A\",\"content\":\"是\",\"score\":null,\"itemUuid\":null},{\"prefix\":\"B\",\"content\":\"否\",\"score\":null,\"itemUuid\":null}],\"correct\":\"B\"}','2023-01-13 16:25:39'),(2,'{\"titleContent\":\"<p><span style=\\\"font-size: 20px;\\\">指导综合性网络信息审核工作，所有类型信息统一指导。</span><br/></p>\",\"analyze\":\"解析\",\"questionItemObjects\":[{\"prefix\":\"A\",\"content\":\"是\",\"score\":null,\"itemUuid\":null},{\"prefix\":\"B\",\"content\":\"否\",\"score\":null,\"itemUuid\":null}],\"correct\":\"A\"}','2023-01-13 16:25:39'),(3,'{\"titleContent\":\"<p><span style=\\\"font-size: 20px;\\\">耶路撒冷是伊斯兰教圣地。</span><br/></p>\",\"analyze\":\"解析\",\"questionItemObjects\":[{\"prefix\":\"A\",\"content\":\"是\",\"score\":null,\"itemUuid\":null},{\"prefix\":\"B\",\"content\":\"否\",\"score\":null,\"itemUuid\":null}],\"correct\":\"A\"}','2023-01-13 16:25:39'),(4,'{\"titleContent\":\"<p><span style=\\\"font-size: 20px;\\\">使用综合性网络信息工具管控风险信息，综合性网络信息工具需具有彻底阻断传播的功能。</span><br/></p>\",\"analyze\":\"解析\",\"questionItemObjects\":[{\"prefix\":\"A\",\"content\":\"是\",\"score\":null,\"itemUuid\":null},{\"prefix\":\"B\",\"content\":\"否\",\"score\":null,\"itemUuid\":null}],\"correct\":\"A\"}','2023-01-13 16:25:39'),(5,'{\"titleContent\":\"<p><span style=\\\"font-size: 20px;\\\">\\\"第一次十字军东征由西方基督教世界所发起，旨在收复在穆斯林的征服中被占领的累范特圣地的一项军事行动。\\\"</span><br/></p>\",\"analyze\":\"解析\",\"questionItemObjects\":[{\"prefix\":\"A\",\"content\":\"是\",\"score\":null,\"itemUuid\":null},{\"prefix\":\"B\",\"content\":\"否\",\"score\":null,\"itemUuid\":null}],\"correct\":\"A\"}','2023-01-13 16:25:39'),(6,'{\"titleContent\":\"<p><span style=\\\"font-size: 20px;\\\">指导综合性网络信息审核工作，只需检查综合性网络信息审核时效即可。</span><br/></p>\",\"analyze\":\"解析\",\"questionItemObjects\":[{\"prefix\":\"A\",\"content\":\"是\",\"score\":null,\"itemUuid\":null},{\"p